import image1 from "assets/img/gridlist/baby_black.jpg";
import image2 from "assets/img/gridlist/baby_blue.jpg";
import image3 from "assets/img/gridlist/sweater_blue.jpg";
import image4 from "assets/img/gridlist/sweater_black.jpg";
import image5 from "assets/img/gridlist/baby_chocolate.jpg";

const tileData = [
	{
      img: image1,
      title: 'baby_black',
      author: 'baby',
      cols: 2,
    },
    {
      img: image2,
      title: 'baby_blue',
      author: 'baby',
      cols: 1,
    },
    {
      img: image3,
      title: 'sweater_black',
      author: 'sweater',
      cols: 1,
    },
    {
      img: image4,
      title: 'sweater_blue',
      author: 'sweater',
      cols: 1,
    },
    {
      img: image5,
      title: 'baby_chocolate',
      author: 'baby',
      cols: 1,
    }
];

const ImageGridListStyle = theme => ({
	root: {
		display: 'flex',
		flexWrap: 'wrap',
		justifyContent: 'space-around',
		overflow: 'hidden',
		backgroundColor: theme.palette.background.paper,
	}
});

export {
	tileData,
	ImageGridListStyle
};
